import React, { useState, useEffect } from "react";
import { getCars, deleteCar } from "../services/api";
import "./CarList.css";

/**
 * CarList component - Placeholder until we create the full version
 */
const CarList = () => {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const carData = await getCars();
      setCars(carData);
    } catch (error) {
      console.error("Error fetching cars:", error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading">Loading cars...</div>;
  }

  return (
    <div className="car-list-container">
      <div className="car-list-header">
        <h1>Car Inventory</h1>
        <button className="btn btn-primary">Add New Car</button>
      </div>

      <div className="cars-grid">
        {cars.map((car) => (
          <div key={car.id} className="car-card">
            <h3>
              {car.make} {car.model}
            </h3>
            <p>Seats: {car.seats}</p>
            <p>ID: {car.id}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CarList;
